import React from 'react'
import Card from 'react-bootstrap/Card'

function Crd(props){
    return(
        <Card>
            <Card.Img variant="top" src="holder.js/100px180" />
            <Card.Body>
            <Card.Title>{props.title}</Card.Title>
            <p>{props.company}</p>
            <small>{props.time}</small>
            <br/>
            <br/>
                <Card.Text>
                    {props.text}
                </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default Crd;
